def minFallingPathSum(grid):
    rows, cols = len(grid), len(grid[0])
    def dfs(row, col):
        if row == rows - 1:
            return grid[row][col]
        if (row, col) in dp:
            return dp[(row, col)]
        min_sum = float("inf")
        for next_col in range(cols):
            if next_col != col:
                min_sum = min(min_sum, grid[row][col] + dfs(row + 1, next_col))         
        dp[(row, col)] = min_sum
        return min_sum
    dp = {}
    min_sum = float("inf")
    for col in range(cols):
        min_sum = min(min_sum, dfs(0, col))
    return min_sum

